n>\n</p>\n<p>\n\t<br />\n</p>\n<p>\n\t<p style=\"font-size:13px;color:#666666;font-family:\'microsoft yahei\';text-indent:7px;background-color:#FFFFFF;\">\n\t\t<span style=\"font-size:18px;\">详询</span>\n\t</p>\n\t<p style=\"font-size:13px;color:#666666;font-family:\'microsoft yahei\';text-indent:7px;background-color:#FFFFFF;\">\n\t\t<span style=\"font-size:16px;\">客服QQ：153289970</span>\n\t</p>\n\t<p style=\"font-size:13px;color:#666666;font-family:\'microsoft yahei\';text-indent:7px;background-color:#FFFFFF;\">\n\t\t<span style=\"font-size:16px;\">用户QQ群：590755485</span>\n\t</p>\n\t<p style=\"font-size:13px;color:#666666;font-family:\'microsoft yahei\';text-indent:7px;background-color:#FFFFFF;\">\n\t\t<span style=\"font-size:16px;\"><br />\n</span>\n\t</p>\n\t<p style=\"font-size:13px;color:#666666;font-family:\'microsoft yahei\';text-indent:7px;background-color:#FFFFFF;\">\n\t\t<span style=\"font-size:16px;\">联系我们</span>\n\t</p>\n\t<p style=\"font-size:13px;color:#666666;font-family:\'microsoft yahei\';text-indent:7px;background-color:#FFFFFF;\">\n\t\t<span style=\"font-size:16px;\"><a href=\"http://www.fi.net/\" target=\"_blank\">http://www.fi.net</a></span>\n\t</p>\n\t<p style=\"font-size:13px;color:#666666;font-family:\'microsoft yahei\';text-indent:7px;background-color:#FFFFFF;\">\n\t\t<span style=\"font-size:16px;\"><a href=\"http://bbs.fi.com/\" target=\"_blank\">http://bbs.shangtaosoft.com</a></span>\n\t</p>\n</p>','fi',1,1,'2016-10-20 11:12:25',0,1),(33,5,'发票制度',1,'<p>\n\t<strong><span style=\"font-size:14px;\">一、 发票开具</span></strong>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">1、所有商品发票均由所属销售商家负责开具，且所有开具的发票均为合法有效。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">2、顾客在结算过程中可以选择是否开具发票，商家会按照顾客的选择为顾客开具发票。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">3、所有商品仅按顾客实付现金金额开具发票，不包括抵用券、返利金额、礼品卡等金额部分。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">4、若顾客订购的是数码、手机、电脑、家电类商品，为了保证顾客能充分享受生产厂家提供的售后服务，无论顾客是否选择开具发票，商家均会随单为顾客开具普通发票，发票内容默认为顾客订购的商品全称和型号，且不支持发票内容修改，如给顾客带来不便，敬请谅解；如需将普通发票换开为增值税专用发票（电子发票不支持换开），则必须退回普通发票原件。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">5、若顾客选择预付卡或积分方式进行支付，则对于该部分支付金额，顾客仅可选择开具0元发票。</span>\n</p>\n<p>\n\t<strong><span style=\"font-size:14px;\">二、普通发票</span></strong>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">1.发票抬头：</span>\n</p>\n<p class=\"txt_indent\" style=\"text-indent:2em;\">\n\t<span style=\"font-size:14px;\">（1）发票抬头不能为空；</span>\n</p>\n<p class=\"txt_indent\" style=\"text-indent:2em;\">\n\t<span style=\"font-size:14px;\">（2）您可填写：\"个人\"、您的姓名、或您的单位名称</span>\n</p>\n<p class=\"txt_indent\" style=\"text-indent:2em;\">\n\t<span style=\"font-size:14px;\">（3）由于税务局提供的开票软件字数限制（最多40个字）剩余字数会和纳税人识别号重叠而无法显示，请索要普票时抬头字数不要超过40个</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">2.发票内容：</span>\n</p>\n<p class=\"txt_indent\" style=\"text-indent:2em;\">\n\t<span style=\"font-size:14px;\">（1）1号店自营：可开具的发票内容：酒、饮料、食品、玩具、日用品、装修材料、化妆品、办公用品、学生用品、家居用品、饰品、服装、箱包、精品、家电、劳防用品。您可根据需要选择。</span>\n</p>\n<p class=\"txt_indent\" style=\"text-indent:2em;\">\n\t<span style=\"font-size:14px;\">（2）入驻商家：发票内容将开具您所订商品的明细。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">3. 如果您在收到货物时请检查发票，并在送货签收单上签字，一旦签字即代表您已收到发票，并且发票无误。对于顾客人为因素引起的发票遗失，我们无法为您补开发票。</span>\n</p>\n<p class=\"txt_indent\" style=\"text-indent:2em;\">\n\t<span style=\"font-size:14px;\">请在提交订单页面，在\"索取发票\"前打钩，按提示填写发票抬头、选择发票内容，发票将会随您的订单商品一起送达：</span>\n</p>\n<p class=\"txt_indent\" style=\"text-indent:2em;\">\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<p class=\"txt_indent\" style=\"text-indent:2em;\">\n\t<span style=\"font-size:14px;\">\n\t<p style=\"font-size:13px;color:#666666;font-family:\'microsoft yahei\';text-indent:7px;background-color:#FFFFFF;\">\n\t\t<span style=\"font-size:16px;\">详询</span>\n\t</p>\n\t<p style=\"font-size:13px;color:#666666;font-family:\'microsoft yahei\';text-indent:7px;background-color:#FFFFFF;\">\n\t\t<span style=\"font-size:16px;\">客服QQ：153289970</span>\n\t</p>\n\t<p style=\"font-size:13px;color:#666666;font-family:\'microsoft yahei\';text-indent:7px;background-color:#FFFFFF;\">\n\t\t<span style=\"font-size:16px;\">用户QQ群：590755485</span>\n\t</p>\n\t<p style=\"font-size:13px;color:#666666;font-family:\'microsoft yahei\';text-indent:7px;background-color:#FFFFFF;\">\n\t\t<span style=\"font-size:16px;\"><br />\n</span>\n\t</p>\n\t<p style=\"font-size:13px;color:#666666;font-family:\'microsoft yahei\';text-indent:7px;background-color:#FFFFFF;\">\n\t\t<span style=\"font-size:16px;\">联系我们</span>\n\t</p>\n\t<p style=\"font-size:13px;color:#666666;font-family:\'microsoft yahei\';text-indent:7px;background-color:#FFFFFF;\">\n\t\t<span style=\"font-size:16px;\"><a href=\"http://www.fi.net/\" target=\"_blank\">http://www.fi.net</a></span>\n\t</p>\n\t<p style=\"font-size:13px;color:#666666;font-family:\'microsoft yahei\';text-indent:7px;background-color:#FFFFFF;\">\n\t\t<span style=\"font-size:16px;\"><a href=\"http://bbs.fi.com/\" target=\"_blank\">http://bbs.shangtaosoft.com</a></span>\n\t</p>\n<br />\n</span>\n</p>','发票',1,1,'2016-10-20 11:16:00',0,0),(34,6,'测试文章标题',1,'测试文章内容','测试文章关键字',1,1,'2016-11-12 14:31:27',0,0);

