#


#
# Structure for table "fi_goods_cats"
#

CREATE TABLE `fi_goods_cats` (
  `catId` int(11) NOT NULL AUTO_INCREMENT,
  `parentId` int(11) NOT NULL,
  `catName` varchar(20) NOT NULL,
  `isShow` tinyint(4) NOT NULL DEFAULT '1',
  `isFloor` tinyint(4) NOT NULL DEFAULT '1',
  `priceSection` int(11) DEFAULT NULL,
  `catSort` int(11) NOT NULL DEFAULT '0',
  `dataFlag` tinyint(4) NOT NULL DEFAULT '1',
  `createTime` datetime NOT NULL,
  PRIMARY KEY (`catId`),
  KEY `parentId` (`parentId`,`isShow`,`dataFlag`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=368 DEFAULT CHARSET=utf8 COMMENT='商品分类表';

