#
# Structure for table "fi_redundancy"
#

CREATE TABLE `fi_redundancy` (
  `redundancyId` int(11) NOT NULL AUTO_INCREMENT,
  `goodsId` int(11) NOT NULL DEFAULT '0' COMMENT '商品id',
  `goodsName` varchar(50) NOT NULL DEFAULT '' COMMENT '商品名称',
  `goodsImg` varchar(150) NOT NULL DEFAULT '' COMMENT '商品图片，会在搜索页面html中转换为缩略图',
  `goodsStock` int(11) NOT NULL DEFAULT '0' COMMENT '商品库存',
  `goodsTips` varchar(255) NOT NULL DEFAULT '' COMMENT '商品促销信息',
  `goodsUnit` char(10) DEFAULT '' COMMENT '商品单位',
  `goodsDesc` text NOT NULL COMMENT '商品描述',
  `avgScore` decimal(6,2) NOT NULL DEFAULT '0.00' COMMENT '商品三项平均分',
  `shopName` varchar(100) NOT NULL DEFAULT '' COMMENT '店铺名',
  `shopPrice` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '商品价格',
  `brandName` varchar(100) NOT NULL DEFAULT '' COMMENT '商品品牌',
  `catName` varchar(255) NOT NULL DEFAULT '' COMMENT '分类名称，以最小分类单元名',
  `appraiseNum` int(11) NOT NULL DEFAULT '0' COMMENT '评价数',
  `saleNum` int(11) NOT NULL DEFAULT '0' COMMENT '销量',
  `province` varchar(50) NOT NULL DEFAULT '' COMMENT '省',
  `city` varchar(50) NOT NULL DEFAULT '' COMMENT '市',
  `district` varchar(50) NOT NULL DEFAULT '' COMMENT '区/县',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0为正常，1为删除，需要同时更改update_time才能起效哦',
  PRIMARY KEY (`redundancyId`),
  KEY `goodsId` (`goodsId`),
  KEY `update_time` (`update_time`,`is_delete`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='solr冗余表';

